}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><polygon points="8 1.91 8 12.7 9 12.7 9 1.91 10.897 3.799 11.603 3.09 8.5 0 5.397 3.09 6.103 3.799 8 1.91" class="aw-theme-iconOutline" fill="#464646"/><polygon points="12 5 12 6 14 6 14 15 3 15 3 6 5 6 5 5 2 5 2 16 15 16 15 5 12 5" class="aw-theme-iconOutline" fill="#464646"/></svg>';
